import Foundation
import UIKit


struct Icons {
    
    static var file: UIImage {
        let strBase64 = ""
        let dataDecoded : Data = Data(base64Encoded: strBase64, options: .ignoreUnknownCharacters)!
        return UIImage(data: dataDecoded)!
    }
    
